sap.ui.define(["sap/ui/base/ManagedObject"],function(t){const o=t.extend("plants.ui.Constants",{});o.base_url=(()=>{if(window.location.hostname==="localhost"&&window.location.port==="8080"){return"http://localhost:5000/api/"}else if(window.location.hostname.endsWith("localhost")&&window.location.port!=="8080"){return"http://plants.localhost/api/"}else{return"https://plants.astroloba.net/api/"}})();return o});